import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Library navigation item to be visible and click it
    await page.waitForSelector('.nav-item[data-page="library"]', { timeout: 5000 });
    await page.click('.nav-item[data-page="library"]');

    // Take a screenshot after clicking the Library item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_library_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_library_clicked.png'));

    // Verify that the Library page has loaded by checking for a specific element
    await page.waitForSelector('h1', { timeout: 5000 }); // Assuming there's an <h1> tag on the Library page

    return {
      success: true,
      action: "Clicked on the Library navigation item in the sidebar",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

